import React from 'react';
import Card  from './Card';


const CardList = ({robots}) => {
    const cardArray = robots.map((user, i) => {
        return (<Card key={i} 
        id={robots[i].id}
         name={robots[2].name}
          email={robots[2].email} />
    )})
    return (
        <div>
            {cardArray}
        </div>
    );
}

export default CardList;
